const fetchRoutines = async () => {
    try {
        const response = await fetch('https://fitnesstrac-kr.herokuapp.com/api/routines',
            {
                headers: {
                    'Content-Type': 'application/json'
                },
            })
        const data = await response.json();
        setRoutines(data);
    } catch (err) {
        console.error(err)
    }
}




